INSERT INTO [dbo].[StringResources] ([Key], [Type], [Base], [Comment], [ID]) VALUES (N'Label.AllowPointerLockToolTip', 0, N'Enables Pointer lock.  Pointer lock provides input methods based on the movement of the mouse over time, not just the absolute position of the mouse cursor. Pointer lock is useful for applications that require significant mouse input to control movements, rotate objects, and change entries. It is particularly essential for highly visual applications, such as those that use first-person perspective, as well as 3D views and modeling. By default, sandboxed iframes block Pointer lock. This attribute allows you to enable Pointer lock on sandboxed iframes.', N'-', 210)
INSERT INTO [dbo].[StringResources] ([Key], [Type], [Base], [Comment], [ID]) VALUES (N'Label.AllowSameOriginToolTip', 0, N'Allows the content to be treated as being from its normal origin. Without this token, the content is forced into a unique origin, thus preventing it from accessing other content from the same origin. Also, without the allow-same-origin token, scripts are prevented from reading from or writing to the document.cookie IDL attribute, and blocks access to localStorage and openDatabase(). [WEBSTORAGE] [WEBSQL].', N'-', 211)
